import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import './Header.css'; 
import typingVideo from './typing.mp4';

import Navigation from "./Navigation.js";

const Header = () => {

  return (

      <div className="landingPageContainer">


            {/* MAIN ANIMATION */}
        <Container className="landingPageContent">

          <Row>

            <Col>

              <div id="MainAnimationContainer">

                <div id="aboutMe">

                  <h1 id="mainGreeting">Hi, I'm Zolaikha</h1>
                  <h5 id="mainTagline">Software Engineer &amp; Experienced Leader</h5>

                  <Button variant="light" href="#myWork" size="lg">More About Me</Button>

                </div>

                <div id="MainAnimationOverlay"></div>

                <video id="MainAnimation" playsInline autoPlay muted loop>
                  <source src={typingVideo} type="video/mp4"/>
                </video>

              </div>

            </Col>

          </Row>

        </Container>

      </div>
  );
};

export default Header;
